import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { ArrowLeft, Camera } from 'lucide-react';

const EditProfile = ({ userName, setUserName }) => {
  const navigate = useNavigate();
  const [tempName, setTempName] = useState(userName);

  const handleSave = () => {
    setUserName(tempName); // Updates global name
    navigate('/profile');
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <ArrowLeft size={24} onClick={() => navigate(-1)} style={{ cursor: 'pointer' }} />
        <h2 style={styles.headerTitle}>Edit Profile</h2>
        <div style={{ width: 24 }}></div>
      </header>

      <div style={styles.formArea}>
        <div style={styles.photoSection}>
          <div style={styles.avatarContainer}>
            <img src="https://images.unsplash.com/photo-1494790108377-be9c29b29330?w=150" alt="avatar" style={styles.avatar} />
            <div style={styles.cameraBadge}><Camera size={14} color="#fff" /></div>
          </div>
          <span style={styles.changeLink}>Change Profile Photo</span>
        </div>

        <div style={styles.inputGroup}>
          <label style={styles.label}>Full Name</label>
          <input type="text" value={tempName} onChange={(e) => setTempName(e.target.value)} style={styles.input} />
        </div>

        <div style={styles.inputGroup}>
          <label style={styles.label}>College Name</label>
          <input type="text" defaultValue="Saraswati Institute of Tech" style={styles.input} />
        </div>

        <div style={styles.inputGroup}>
          <label style={styles.label}>Register Number</label>
          <input type="text" defaultValue="REG20248891" style={styles.input} />
        </div>

        <button onClick={handleSave} style={styles.saveBtn}>Save Changes</button>
        <button onClick={() => navigate(-1)} style={styles.cancelBtn}>Cancel</button>
      </div>
    </div>
  );
};

const styles = {
  container: { backgroundColor: '#fff', minHeight: '100vh' },
  header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '16px', borderBottom: '1px solid #f1f5f9' },
  headerTitle: { fontSize: '18px', fontWeight: 'bold', margin: 0 },
  formArea: { padding: '24px' },
  photoSection: { textAlign: 'center', marginBottom: '30px' },
  avatarContainer: { position: 'relative', width: '90px', height: '90px', margin: '0 auto' },
  avatar: { width: '100%', height: '100%', borderRadius: '50%', objectFit: 'cover' },
  cameraBadge: { position: 'absolute', bottom: 0, right: 0, backgroundColor: '#5c5cfc', padding: '6px', borderRadius: '50%', border: '3px solid #fff' },
  changeLink: { color: '#5c5cfc', fontSize: '13px', fontWeight: 'bold', marginTop: '10px', display: 'block' },
  inputGroup: { marginBottom: '20px' },
  label: { fontSize: '12px', color: '#94a3b8', marginBottom: '6px', display: 'block' },
  input: { width: '100%', padding: '12px 16px', borderRadius: '12px', border: '1px solid #f1f5f9', backgroundColor: '#f8fafc', boxSizing: 'border-box' },
  saveBtn: { width: '100%', padding: '14px', backgroundColor: '#5c5cfc', color: '#fff', border: 'none', borderRadius: '12px', fontWeight: 'bold', marginTop: '10px' },
  cancelBtn: { width: '100%', padding: '14px', backgroundColor: 'transparent', color: '#94a3b8', border: 'none', borderRadius: '12px', marginTop: '5px' }
};

export default EditProfile;
